import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import '../styles/SignUp.css';
import { ReactComponent as SigninCat } from '../icons/register-cat.svg';

function SignUp() {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [username, setUsername] = useState('');
    const [email, setEmail] = useState('');
    const [location, setLocation] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [message, setMessage] = useState('');

    const doSignUp = async event => {
        event.preventDefault();

        if (password !== confirmPassword) {
            setMessage("Passwords do not match!");
            return;
        }

        try {
            const response = await fetch('/api/register', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({
                    firstName,
                    lastName,
                    email,
                    location,
                    login: username,
                    password,
                }),
            });

            const result = await response.json();
            setMessage(result.message);

            if (response.ok) {
                // Handle successful registration, e.g., redirect to login page
                // window.location.href = '/login';
            }
        } catch (error) {
            console.error('Error:', error);
            setMessage('An error occurred. Please try again.');
        }
    };

    return (
        <div id="SignupDiv">
            <div id="signup-text">
                <div id="signup-header">
                    <SigninCat />
                    <span id="inner-title">Register</span><br />
                </div>

                <div id="username-box">
                    <span id="signup-title">First Name</span><br />
                    <input
                        type="text"
                        id="firstname"
                        value={firstName}
                        onChange={e => setFirstName(e.target.value)}
                    /><br />
                </div>

                <div id="username-box">
                    <span id="signup-title">Last Name</span><br />
                    <input
                        type="text"
                        id="lastname"
                        value={lastName}
                        onChange={e => setLastName(e.target.value)}
                    /><br />
                </div>

                <div id="username-box">
                    <span id="signup-title">Username</span><br />
                    <input
                        type="text"
                        id="username"
                        value={username}
                        onChange={e => setUsername(e.target.value)}
                    /><br />
                </div>

                <div id="username-box">
                    <span id="signup-title">Email Address</span><br />
                    <input
                        type="text"
                        id="email"
                        value={email}
                        onChange={e => setEmail(e.target.value)}
                    /><br />
                </div>

                <div id="username-box">
                    <span id="signup-title">Location</span><br />
                    <input
                        type="text"
                        id="location"
                        value={location}
                        onChange={e => setLocation(e.target.value)}
                    /><br />
                </div>

                <div id="password-box">
                    <span id="signup-title">Password</span><br />
                    <input
                        type="password"
                        id="registerpassword"
                        value={password}
                        onChange={e => setPassword(e.target.value)}
                    /><br />
                </div>

                <div id="password-box">
                    <span id="signup-title">Confirm Password</span><br />
                    <input
                        type="password"
                        id="confirmpassword"
                        value={confirmPassword}
                        onChange={e => setConfirmPassword(e.target.value)}
                    /><br />
                </div>

                <input
                    type="submit"
                    id="loginButton"
                    className="buttons"
                    value="Create Account"
                    onClick={doSignUp}
                />
                <span id="loginResult">{message}</span>

                <p>Already have an <a href='/login'><span>account?</span></a></p>

            </div>
        </div>
    );
};

export default SignUp;
